import React from 'react'
import { Outlet } from 'react-router-dom'
import {
  Card,
  Typography,
  List,
  ListItem,
  ListItemPrefix,
  ListItemSuffix,
  Chip,
} from "@material-tailwind/react";
import {
  PresentationChartBarIcon,
  ShoppingBagIcon,
  UserCircleIcon,
  Cog6ToothIcon,
  InboxIcon,
  PowerIcon,
} from "@heroicons/react/24/solid";
export default function Layout() {
  return (
    <div className='flex flex-row bg-natural-100 h-screen w-screen'>
      <div>Hellow wolrd</div>
      <div>Howdy</div>
      <div>Boyca wolrd</div>
      <div>Bruno wolrd</div>
  
        <div>{<Outlet/>}</div>
    </div>
  )
}
